    "2015-12-09T02:42:46.655402",nt"name": "habitat-offshore-of-refugio-beach-california",nt"isopen":
    false,nt"url": null,nt"notes": "This part of SIM 3319 presents the habitat
    map of the seafloor (see sheet 7) offshore of Refugio Beach, California (vector
    data file is included in "Habitat_RefugioBeach.zip," which is accessible from
    http://pubs.usgs.gov/ds/781/OffshoreRefugioBeach/data_catalog_OffshoreRefugioBeach.html).
    Using multibeam echosounder (MBES) bathymetry and backscatter data, potential marine
    benthic habitat maps were constructed. The habitats were based on substrate types
    and documented or "ground truthed" using underwater video images and seafloor
    samples obtained by the USGS. These maps display various habitat types ranging from
    flat, soft consolidated sediment-covered seafloor to hard, deformed (folded) or
    highly rugose and differentially eroded bedrock exposures. Rugged, high relief rocky
    outcrops that have been eroded to form ledges and small caves are ideal habitat
    for rockfish (Sebastes spp.) and other bottom fish such as lingcod (Ophiodon elongatus).
    Habitat maps will be presented in a map format generated in a GIS (ArcMap) and both
    digital and hard copy versions will be produced.",nt"license_title": null,nt"extras":
